import axios from 'axios';

const instagramPostsUrl = process.env.REACT_APP_INSTAGRAM_POSTS_URL;

const API_KEY = process.env.REACT_APP_API_KEY;

const FetchUserTiktokPosts = async (id, setTikTokPosts) => {
  console.log(id);
  try {
    const response = await fetch(
      `https://tiktok-scraper7.p.rapidapi.com/user/posts`,
      {
        method: 'GET',
        params: {
          unique_id: 'PoliceControl',
          count: 9,
          cursor: 0,
        },
        headers: {
          'x-rapidapi-host': 'tiktok-scraper7.p.rapidapi.com',
          'x-rapidapi-key': API_KEY,
        },
      }
    );

    console.log(response.data);
  } catch (error) {
    console.error('Error fetching TikTok posts:', error);
    return 'Error';
  }
};

export default FetchUserTiktokPosts;
